using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// An NSExtensionItem object is an immutable collection of values representing different aspects of an item for the extension to act upon.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Foundation/Reference/NSExtensionItem_Class/index.html#//apple_ref/occ/cl/NSExtensionItem"/>    [iOSVersion(8)]    [Export("")]    public class NSExtensionItem : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSCoding, NSCopying, NSObjectProtocol, NSSecureCoding, Printable    {        public NSExtensionItem() { }        /// <summary>        /// An optional title for the item.        /// </summary>        [iOSVersion(8)]        [Export("attributedTitle")]        [Optional]        public NSAttributedString AttributedTitle { get; set; }                /// <summary>        /// An optional dictionary of keys and values corresponding to the extension itemâ€™s properties.        /// </summary>        [iOSVersion(8)]        [Export("userInfo")]        public Dictionary<NSObject, AnyObject> UserInfo { get; set; }                /// <summary>        /// An optional array of media data associated with the extension item.        /// </summary>        [iOSVersion(8)]        [Export("attachments")]        public AnyObject[] Attachments { get; set; }                /// <summary>        /// An optional string describing the extension item content.        /// </summary>        [iOSVersion(8)]        [Export("attributedContentText")]        [Optional]        public NSAttributedString AttributedContentText { get; set; }    }}